import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Home from './Home';
import Diy from './Diy';

const Content = () =>{
    return(
        <Switch>
            <Route exact path="/" component={Home}/>
            <Route path="/diy" component={Diy}/>
        </Switch>
    )
}

export default Content;
